contracts/AnonymousFeedback.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AnonymousFeedback {
    // Array to store all feedback submissions
    string[] private feedbackList;

    // Event to emit when new feedback is submitted
    event FeedbackSubmitted(uint256 indexed feedbackId);

    // Function to submit new feedback
    function submitFeedback(string memory _feedback) public {
        require(bytes(_feedback).length > 0, "Feedback cannot be empty");
        feedbackList.push(_feedback);
        emit FeedbackSubmitted(feedbackList.length - 1);
    }

    // Function to get the total number of feedback submissions
    function getFeedbackCount() public view returns (uint256) {
        return feedbackList.length;
    }

    // Function to get a specific feedback by index
    function getFeedbackByIndex(uint256 _index) public view returns (string memory) {
        require(_index < feedbackList.length, "Index out of bounds");
        return feedbackList[_index];
    }

    // Function to get all feedback (only callable by educators)
    function getAllFeedback() public view returns (string[] memory) {
        return feedbackList;
    }
}

contracts/AssignmentSubmission.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AssignmentSubmission {
    struct Submission {
        address student;
        string assignmentHash;
        uint256 timestamp;
        bool verified;
    }

    Submission[] public submissions;
    mapping(address => bool) public educators;

    event SubmissionAdded(address indexed student, string assignmentHash, uint256 timestamp);
    event SubmissionVerified(address indexed student, string assignmentHash, uint256 timestamp);

    constructor() {
        educators[msg.sender] = true;
    }

    modifier onlyEducator() {
        require(educators[msg.sender], "Only educators can call this function");
        _;
    }

    function addEducator(address _educator) public onlyEducator {
        educators[_educator] = true;
    }

    function submitAssignment(string memory _assignmentHash) public {
        submissions.push(Submission({
            student: msg.sender,
            assignmentHash: _assignmentHash,
            timestamp: block.timestamp,
            verified: false
        }));
        emit SubmissionAdded(msg.sender, _assignmentHash, block.timestamp);
    }

    function verifySubmission(uint256 _index) public onlyEducator {
        require(_index < submissions.length, "Invalid submission index");
        require(!submissions[_index].verified, "Submission already verified");

        submissions[_index].verified = true;
        emit SubmissionVerified(submissions[_index].student, submissions[_index].assignmentHash, block.timestamp);
    }

    function getSubmissionsCount() public view returns (uint256) {
        return submissions.length;
    }

    function getSubmission(uint256 _index) public view returns (address, string memory, uint256, bool) {
        require(_index < submissions.length, "Invalid submission index");
        Submission memory sub = submissions[_index];
        return (sub.student, sub.assignmentHash, sub.timestamp, sub.verified);
    }
}

contracts/ClassPoll.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ClassPoll {
    struct Poll {
        string question;
        string[] options;
        uint256[] votes;
    }

    Poll public currentPoll;
    address public owner;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this function");
        _;
    }

    function createPoll(string memory _question, string[] memory _options) public onlyOwner {
        require(_options.length > 1, "A poll must have at least two options");
        currentPoll.question = _question;
        currentPoll.options = _options;
        currentPoll.votes = new uint256[](_options.length);
    }

    function vote(uint256 _optionIndex) public {
        require(_optionIndex < currentPoll.options.length, "Invalid option index");
        currentPoll.votes[_optionIndex]++;
    }

    function getCurrentPoll() public view returns (Poll memory) {
        return currentPoll;
    }

    // New function to get vote counts
    function getVoteCounts() public view returns (uint256[] memory) {
        return currentPoll.votes;
    }
}

contracts/Greeter.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Greeter {
    string message = "Hello, world!";

    function read() public view returns (string memory) {
        return message;
    }

    function write(string memory newMessage) public {
        message = newMessage;
    }
}

contracts/StudyGroup.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract StudyGroup {
    struct Message {
        address sender;
        string content;
        uint256 timestamp;
    }

    Message[] public messages;
    mapping(address => bool) public members;

    event MessageSent(address indexed sender, string content, uint256 timestamp);
    event MemberJoined(address indexed member);

    function joinGroup() public {
        require(!members[msg.sender], "Already a member");
        members[msg.sender] = true;
        emit MemberJoined(msg.sender);
    }

    function sendMessage(string memory _content) public {
        require(members[msg.sender], "Must be a member to send messages");
        require(bytes(_content).length > 0, "Message cannot be empty");
        require(bytes(_content).length <= 280, "Message too long");

        messages.push(Message(msg.sender, _content, block.timestamp));
        emit MessageSent(msg.sender, _content, block.timestamp);
    }

    function getMessages() public view returns (Message[] memory) {
        return messages;
    }

    function getMemberStatus(address _address) public view returns (bool) {
        return members[_address];
    }
}

